import React from 'react';

const PopUp = ({photoId, photos}) => {
  let image = photos.filter( photo => {
    return photo.id === photoId
  });
  const getImage = <img src={image[0].url} />;



  return (
    <div>
      <div className="popup-overlay">
      </div>
      <div className="new-card-component"> {getImage} </div>
    </div>
  );
}

export default PopUp;
